<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        body {
          margin: 0;
          padding: 0;
          background-color: black;
          overflow: hidden; /* Prevent scrollbars on PC browsers */
          display: flex;
          justify-content: center;
          align-items: center;
          height: 100vh;
        }

        #player {
          width: 100%;
          max-width: 100%;
          display: flex;
          justify-content: center;
          align-items: center;
          object-fit: contain;
        }

        @media screen and (max-width: 768px) {
            #player {
                height: 100vh; /* Adjusted for mobile browsers */
                position: relative; /* Keep it centered */
                max-height: 100vh;
            }
        }
		
		/* Style for the footer section with the Telegram logo and link */
		.footer {
			display: flex;
			align-items: center;
			justify-content: center;
			background-color: #222;
			color: white;
			padding: 10px;
			position: absolute; /* Position it at the bottom */
			bottom: 0; /* Stick it to the bottom */
			width: 100%; /* Full width */
		}

		.telegram-link {
			display: flex;
			align-items: center;
			margin: 0 10px;
			text-decoration: none;
			color: white;
		}

		.telegram-link svg {
			width: auto; /* Allow the width to adjust to the content */
			height: 30px; /* Increase the height */
			vertical-align: middle;
			margin: 0 5px;
		}

		/* Style for the "Telegram channel" link within the paragraph */
		.red-link {
			color: red;
			font-size: 20px; /* Increase the font size as needed */
		}

    </style>
